<p>My expected result:</p>

<pre class="lang-py prettyprint-override"><code>
{
    "name": "David",
    "age": 20,
    "addresses": [
        {
            "radius": 10000,
            "location": {
                "type": "Point",
                "coordinates": [105.785299, 20.979733]
            },
            "distance": 2000``// &lt;------ add distance here for each addesss`
        },
        {
            "radius": 30000,
            "location": {
                "type": "Point",
                "coordinates": [105.785299, 20.979733]
            },
            "distance": 30000 // &lt;------ add distance here for each addesss
        }
    ]
}
</code></pre>

<p>So next stage I can compare <code>distance</code> with <code>radius</code> and keep proper adddress
Anybody know how to do it ? thanks</p>

