Trying to integrate mongoDB to Dialogflow with inline editor<p>I'm trying to integrate mongoDB to Dialogflow. More specifically, I'm trying to change the value of a particular data field called 'lightState' in a MongoDB database installed in AWS EC2 instance, by using DialogFlow. When I say 'Turn the light on', the data 'lightState' has to be updated to the value 1 and 0 for the opposite. </p>

<p>Before heading to the real question, I will post my code below:</p>

<pre><code>var tunnel = require('tunnel-ssh');
var mongoLib = require('mongodb');
var config = {
    username: 'ubuntu',
    host: &lt;my-host-ip-address&gt;,
    port: 22,
    privateKey: &lt;my-aws-instance-private-key&gt;
    dstHost: '127.0.0.1',
    dstPort: 27017,
    localPort: 24800
};

const functions = require('firebase-functions');
const {WebhookClient} = require('dialogflow-fulfillment');
const {Card, Suggestion} = require('dialogflow-fulfillment');

process.env.DEBUG = 'dialogflow:debug'; // enables lib debugging statements

exports.dialogflowFirebaseFulfillment = functions.https.onRequest((request, response) =&gt; {
const agent = new WebhookClient({request, response});
console.log('Dialogflow Request headers: ' + JSON.stringify(request.headers));
console.log('Dialogflow Request body: ' + JSON.stringify(request.body));

var server = tunnel(config, function(error, server){
if(error) throw error;
else {
  if(server != null){
    var Client = mongoLib.MongoClient('mongodb://127.0.0.1:24601/',{useUnifiedTopology:true, auto_reconnect: true});
        var conn = Client.connect(function(error, client){
            if(error) console.log(error);

            function welcome(agent) {
              agent.add(`Welcome to my agent!`);
            }

            function fallback(agent) {
              agent.add(`I didn't understand`);
              agent.add(`I'm sorry, can you try again?`);
            }

      function handleOn(agent)
        {
              const state = agent.parameters.on;
              var doc = {};
              client.db('test_db').collection('light').find().toArray(function(err,docs){
                 doc = docs; //retrieve the data format
              });
              if(state == 1) client.db('test_db').collection('light').update(doc, {$set: {lightState: 1}});  //set lightState to 1 if 'on' state equals 1.       
         }


      function handleOff(agent)
         {
          const state = agent.parameters.off;
          var doc = {};
          client.db('test_db').collection('light').find().toArray(function(err,docs){
             doc = docs;
          });
          if(state == 1) client.db('test_db').collection('light').update(doc, {$set: {lightState: 0}}); //set lightState to 0 if 'off' state equals 1.
          }

    let intentMap = new Map();
    intentMap.set('Default Welcome Intent', welcome);
    intentMap.set('Default Fallback Intent', fallback);
    intentMap.set('light_On', handleOn);
    intentMap.set('light_Off', handleOff);
    agent.handleRequest(intentMap);         
      });
   }
  }
 });
});
</code></pre>

<p>Above is the code in DialogFlow's Inline Editor. After deploying the code in the Inline Editor and for the first time I ask DialogFlow to turn lights on or off, everything works fine and the data field in the AWS EC2's mongoDB database changes successfully. But when I try asking Dialogflow to turn lights on/off again, the logs Viewer on Google Cloud Console shows the following error:</p>

<pre><code>"Error: listen EADDRINUSE 127.0.0.1:24800
at Server.setupListenHandle [as _listen2] (net.js:1360:14)
at listenInCluster (net.js:1401:12)
at doListen (net.js:1510:7)
at _combinedTickCallback (internal/process/next_tick.js:142:11)
at process._tickDomainCallback (internal/process/next_tick.js:219:9)" 
</code></pre>

<p>I know it means I have multiple processes running on the port 24800. But I don't know how to reuse this MongoDB server continuously on the same port 24800, so that I could ask DialogFlow multiple times to change data in MongoDB. Is there any way for doing this?</p>

<hr>

<p>I tried to initiate the ssh server before onRequest function runs. Here's a small bit of the code to show what I've revised:</p>

<pre><code>  var server = tunnel(config, function(error, server){
  exports.dialogflowFirebaseFulfillment = functions.https.onRequest((request, 
  response) =&gt; {
         ...
</code></pre>

<p>However it seems that the Inline Editor fails to recognize the function 'dialogflowFirebaseFulfillment', which is associated with the event handler function onRequest. The error log shows below :</p>

<pre><code> 2020-05-24 18:44:49.459 JST
 dialogflowFirebaseFulfillment
 Node.js module defined by file index.js is expected to export function 
 named dialogflowFirebaseFulfillment
</code></pre>

<p>After trying the method above, I came up with the idea of dynamically allocating the port if the port is busy. But I couldn't find anything coming in handy. So I'm stuck for hours trying to find out what could be the cause of the error.  </p>

