Mongodb Query - cumulative sum<p>In my database I have activities performed in different periods (start in a day and finish another day). This is an example of a document:</p>

<pre><code>    {
        "activity" : "test",
        "period" : [ ISODate("2020-01-01T00:00:00Z"), ISODate("2020-02-10T00:00:00Z")]
    }
</code></pre>

<p>The "period" is  an array of 2 elements, the first is the start time and the second is the end.</p>

<p>I would like to write a query which gives me in output the number of activities in the time. </p>

<p>For better understating, considering this 2 activities:</p>

<pre><code>{
    "activity" : "first_activity",
    "period" : [ ISODate("2020-01-01T00:00:00Z"),ISODate("2020-02-10T00:00:00Z")]
},
{
    "activity" : "second_activity",
    "period" : [ ISODate("2020-01-13T00:00:00Z"), ISODate("2020-01-26T00:00:00Z")]
}
</code></pre>

<p>My goal is an output which allows me to draw a graph of couples ( date , #activities ), something like this:</p>

<pre><code>{
        "quantity" : 1,
        "date" : ISODate("2020-01-01T00:00:00Z")
},
{
        "quantity" : 2,
        "date" : ISODate("2020-01-13T00:00:00Z")
},
{
        "quantity" : 1,
        "date" : ISODate("2020-01-26T00:00:00Z")
},
{
        "quantity" : 0,
        "date" : ISODate("2020-02-10T00:00:00Z")
}
</code></pre>

<p>Unfortunately I didn't reach the final result yet... and probably I'm writing a query not in a "very nice way"...
My logic flow is the following:</p>

<ol>
<li>using unwind for twice each document keeping in memory the
arrayindex,</li>
<li>setting the +1/-1 value for later counting in accordance to the arrayindex,</li>
<li>sorting per date all the results</li>
<li>grouping all the documents per day, making the sum of the value (+1 and -1)</li>
<li><strong>MISSING STEP:</strong> The sum should be accumulative</li>
</ol>

<p>So, by writing this query:</p>

<pre><code>[
 { $unwind : {
        path: "$period",
        includeArrayIndex: "arrayIndex"
      }
    },
 {
    $project: { _id:0, date: "$period", val: { $cond: { if : { $lt: ["$arrayIndex",1] } , then: 1 , else: -1 } }} 
 },
 {
     $sort : { date : 1}
 },
