  (element) =&gt; element.id === original.id
);

list.vendors[indexOfUpdate].id = updatedVendor.id;
list.vendors[indexOfUpdate].name = updatedVendor.name;

const updated = await list.save();
res.json(updated);
</code></pre>

<p>The <code>save()</code> isn't updating the existing document on the DB side. I've console logged that the <code>list.vendors</code> array of objects is, indeed, being changed, but <code>save()</code> isn't doing the saving.</p>

