<p>So how can I count <code>data</code>'s message and sort this documents by descending message?</p>; Answer: BTW, this is a problem specific to `php` (and perhaps other loosely typed languages), due to its extreme willingness to automatically convert values from one type to another.  In strongly typed languages (e.g. Java, C#, C++),  most programmers prefer concise syntax such as `!value` ("not value") instead of `value == false` or `value === false`.  In those languages, the compiler will complain if `value` is not a Boolean type, so the concise form is safe. `"not value"` has a clear meaning, both in logic and in human language; it is only the "looseness" of `php` that makes this form poor to use.

