<p>So the problem is:</p>

<blockquote>
  <p>When I am using just one <code>model</code> with <code>require</code> (CommonJS) the function ends properly with the following message: <code>Process finished with exit code 0</code>, but when I add the second model to the file (<em><code>model2</code> in my case, but it could be any model file or another function with <code>require</code> model</em>) then function doesn't end. </p>

