  I have seen on SO other questions about <code>connection.close</code> like this <a href="https://stackoverflow.com/questions/8813838/properly-close-mongooses-connection-once-youre-done">one</a>, but none of them have been relevant to my problem. Docs said that one <code>close()</code> is enough and it closes all the connections in a pool.</p>
</blockquote>

<p>Every model that I import have the following structure, without any exceptions:</p>

<pre><code>const mongoose = require('mongoose');
