<p>Cause <code>model</code> code doesn't have any <code>setTimeout</code> or other function except <code>connect</code> to DB it shouldn't block the thread. So I can't understand what's going wrong with that and I guess someone on SO have already face the similar problem and could provide some clarification to me. Or it a normal behavior of async function and I shouldn't see a problem in it?</p>

